import React,{useState} from 'react';
import Card from './Card';
import './index.css';
import Card_data from './Card_data';

function all_card(val) {
  return (
    <Card
      key={val.id}
      img_src={val.img_src}
      org_name={val.org_name}
      ser_name={val.ser_name}
      button={val.button}
    />
  );
};



function App() {
  const [bg, setBg] = useState('#fff')
  const [color, setColor] = useState('#000')

  function bgColorChange(){
    setBg('#000')
    setColor('#fff')
  };

  function bgBack(){
    setBg('#fff')
    setColor('#000')
  };

  return (
    <>
        <h1 style={{backgroundColor: bg , color: color}} className="heading">TOP RATED NETFLIX SERIES</h1>
        <button onClick={bgColorChange} onDoubleClick = {bgBack}>ENABLE DARK MODE</button>
        {Card_data.map(all_card)};
    </>
  );
}

export default App;
